import "./order.styles.scss";

const Order = ({  }) => (
  <div className="order">
    <h2 className="order-title">ORDER # 123123123123</h2>
    <div className="order-area">
      <div>
        <OrderItem />
        <OrderItem />
      </div>
      <div className="item-details"></div>
    </div>
  </div>
);

export default Order;
